window.extension={randomList:function(arr,f,r){var i=Math.floor(10*Math.random()%arr.length+1),returnObj={value:arr[i],index:i};if(f){var arr1=Object.assign([],arr);arr1.splice(i,1),returnObj.filter=arr1}if(null!=r){var arr2=Object.assign([],arr);arr2.splice(i,1,r),returnObj.replace=arr2}return returnObj}};